import React from 'react';
import { Container } from './styled/Container.styled';
import { Styledhuddlelandingpage } from './styled/Landingpage.styled';
import fbicon from './images/facebook-f.svg';
import logo from './images/logo.svg';
import mockups from './images/illustration-mockups.svg';

export const Huddlelandingpage = () => {
  return (
    <Container>
        <Styledhuddlelandingpage>
            <img src={logo} alt='logo' />
            <img src={mockups} alt='mockups' />
            <h1>isi hati dengan cinta untuk semua orang</h1>
            <img src={fbicon} alt='fbicon' width={30} />
        </Styledhuddlelandingpage>
    </Container>
  )
}
